import React, {useState, useEffect} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link,
} from 'react-router-dom';

const GoBack = ({path}) => {
  return (
    <div className="goback" dir="rtl">
    <Route>
      <Link to={path}>
        <span class="material-icons">keyboard_backspace</span>
      </Link>
    </Route>
    </div>
  );
}

export default GoBack;
